import "./App.css";
import DiaryEditor from "./component/DiaryEditor/DiaryEditor";
import DiaryList from "./component/DiaryList/DiaryList";

const dummyList = [
  {
    id: 1,
    author: "박현재",
    contents: "오늘은 재미있는 하루였다.",
    emotion: 1,
    created_at: new Date(),
  },
  {
    id: 2,
    author: "박현재",
    contents: "The best day ever!",
    emotion: 4,
    created_at: new Date(),
  },
  {
    id: 3,
    author: "박현재",
    contents: "What a fun day!",
    emotion: 2,
    created_at: new Date(),
  },
]

function App() {
  return (
    <>
      <DiaryEditor />
      <DiaryList diaryList={dummyList}/>
    </>
  );
}

export default App;
